#	- d: right
#	- s: jump
#	- r: restart
#	- q: quit
# - The game is intentianally very hard but 100% doable if you take the path to the left as I wanted to make it difficult since its just one level. Goodluck with this path.
# - I have provided a shortcut that skips the hard part which I showcase in the demo so its easier to test all the features.
# - During the video demo I forgot to explicitly show that you cannot go out of the map on the left and right but its easy to test yourself that it stops you. In the video I show the left side only.
# - In order to convert my images into the proper RGB colour codes, I created a small python script for converting all sprites and backbrounds into the nice format you see
