#### GAME DATA ####
.eqv BASE_ADDRESS 0x10008000		# The address for the first pixel
.eqv MAX_PIXELS 4096			# The last pixel in the screen, 64 x 64
.eqv OFFSET 256				# Pixel offset for one row
.eqv DEFAULT_FRAME_RATE 35		# Adjustable frame rate

curPlayerLocation: .word 0x10008000	# Current location of the player (top left of sprite)
spawnpoint: .word 0x1000B408 		# Player spawnpoint
collision: .word 0			# : No collision, 1: Platform collision detected
jumpCount: .word 0			# Counter for amount of jumps done to see if they can double jump
playerState: .word 0   			# 0: Standing state, 1: Jumping state, 2: Falling state
jumpFrames: .word 0			# Counter for the amount of frames the player is jumping for

## Enemy related
droneLocation: .word 0x10008028		# Current location of drone
originalDroneLocation: .word 0x10008028 # The starting position of the drone enemy
droneDirection: .word 0			# Current direction the drone is moving
droneCount: .word 0 			# Amount of moves in a direction the drone enemy has took
droneFrameCount: .word 0 		# Used to skip every second frame to move slower
rollerLocation: .word 0x100095FC	# Current location of roller
originalRollerLocation: .word 0x100095FC # The starting position of roller enemy
rollerDirection: .word 0		# Current direction the drone is moving
rollerCount: .word 0			# Amount of moves in a direction the roller enemy has took
rollerFrameCount: .word 0		# Used to skip every second frame to move slower
shooterLocation1: .word 0x1000B4D4	# Location of shooter 1 (the bottom one)
shooterLocation2: .word 0x10008DDC	# Location of shooter 2 (the top one)
locbullet1: .word 0x1000B8D4		# Current location of bullet 1
locoriginalBullet1: .word 0x1000B8D4   	# The starting position of shooting enemy 1's bullet
locbullet2: .word 0x100091DC		# Current locatino of bullet 2
locoriginalBullet2: .word 0x100091DC	# The starting position of shooting enemy 2's bullet
heartStart: .word 0x10009F08		# Location of first herat to be drawn
lives: .word 3				# Current lives the player has
## Colours
platformColour: .word 0x2B2B2B 		# Unique platform colour used for collision detection
bulletColour: .word 0xFF7E00		# Unique bullet colour used for hit detection
shooterColour: .word 0x4A0741		# Unique shooting enemy colour used for hit detection
rollerColour: .word 0x7F9E94		# Unique dolling enemy colour used for hit detection
droneColour: .word 0x0A1441		# Unique drone enemy colour used for hit detection
wrenchColour: .word 0x8F8F8F		# Unique wrench colour used for win detection

.text
.globl main


#### Start up/reseting and level drawing ####
main:
	j make_level			# Create the first level/ setup the game

make_level:
	li $t0, BASE_ADDRESS
	la $t1, level
	li $t2, MAX_PIXELS
	
	draw_level:
		beqz $t2, drawn_level	# If all pixels are drawn, exit loop

    		lw $t3, 0($t1)		# Load pixel color from level
    		sw $t3, 0($t0)		# Store pixel color to display

    		addi $t0, $t0, 4	# Move to next display pixel
    		addi $t1, $t1, 4	# Move to next image pixel
    		subi $t2, $t2, 1	# Decrement pixel counter

    		j draw_level
    		
    	drawn_level:
    		lw $t0, spawnpoint	# Load spawn point
    		sw $t0, curPlayerLocation # Update current player location to spawnpoint
    		jal draw_player		# Draw the players character
    		jal draw_hearts		# Showcases the amount of lives left
    		j game_loop 		# Replace with game loop later
    		
    		
lose_screen:	
	li $t0, BASE_ADDRESS
	la $t1, lose
	li $t2, MAX_PIXELS
	
	draw_lose:
		beqz $t2, drawn_lose	# If all pixels are drawn, exit loop

    		lw $t3, 0($t1)		# Load pixel color from level1
    		sw $t3, 0($t0)		# Store pixel color to display

    		addi $t0, $t0, 4	# Move to next display pixel
    		addi $t1, $t1, 4	# Move to next image pixel
    		subi $t2, $t2, 1	# Decrement pixel counter

    		j draw_lose
    		
    	drawn_lose:
    		li $t9, 0xffff0000 
    		lw $t8, 0($t9) 
    		beq $t8, 1, keypress_happened_after_lose #Checks if the user is restarting or quiting the game from lose screen
    		
    		j drawn_lose
    		
    		
win_screen:	
	li $t0, BASE_ADDRESS
	la $t1, win
	li $t2, MAX_PIXELS
	
	draw_win:
		beqz $t2, drawn_win	# If all pixels are drawn, exit loop

    		lw $t3, 0($t1)		# Load pixel color from level1
    		sw $t3, 0($t0)		# Store pixel color to display

    		addi $t0, $t0, 4	# Move to next display pixel
    		addi $t1, $t1, 4	# Move to next image pixel
    		subi $t2, $t2, 1	# Decrement pixel counter

    		j draw_win
    		
    	drawn_win:
    		li $t9, 0xffff0000 
    		lw $t8, 0($t9) 
    		beq $t8, 1, keypress_happened_after_win #Checks if the user is restarting or quiting the game from win screen
    		
    		j drawn_win
    		
    		
keypress_happened_after_lose:
	lw $t2, 4($t9) 			# Assumes $t9 is set to 0xfff0000 from before 
	beq $t2, 0x71, quit		# ASCII code of 'q' is 0x71, quit the game if pressed
	beq $t2, 0x72, reset		# ASCII code of 'r' is 0x72, reset the game if pressed
	
	j drawn_lose
	
	
keypress_happened_after_win:
	lw $t2, 4($t9) 			# Assumes $t9 is set to 0xfff0000 from before 
	beq $t2, 0x71, quit		# ASCII code of 'q' is 0x71, quit the game if pressed
	beq $t2, 0x72, reset		# ASCII code of 'r' is 0x72, reset the game if pressed
	
	j drawn_win
		
		
reset:

	lw $t0, locoriginalBullet1 
	sw $t0, locbullet1     		# Reset bullet location
	
	lw $t0, locoriginalBullet2
	sw $t0, locbullet2     		# Reset bullet location
	
	lw $t0, originalDroneLocation
	sw $t0, droneLocation 		# Reset drone location
	
	sw $zero, droneDirection 	# Reset drone stats
	sw $zero, droneCount
	sw $zero, droneFrameCount
	
	lw $t0, originalRollerLocation
	sw $t0, rollerLocation 		# Reset roller location
	
	sw $zero, rollerDirection 	# Reset roller stats
	sw $zero, rollerCount
	sw $zero, rollerFrameCount
	
	lw $t0, lives
	li $t1, 3
	sw $t1, lives			# Reset lives
	
	j make_level
	
	
respawn: 
	jal reset_bullet1		# Resets bullets
	jal reset_bullet2
	
	lw   $t1, lives  		
    	addi $t1, $t1, -1               
    	sw   $t1, lives			# Decrement lives
    	beqz $t1, lose_screen 		# Checks if the player lost
    	
	j make_level			# Remake the level to spawn the player at the start
	
	
#### Game Loop ####
game_loop:
    	li $t9, 0xffff0000 
    	lw $t8, 0($t9) 
    	beq $t8, 1, keypress_happened 	# Checks for a keypress
    	
    	
    	li $v0, 32 
    	li $a0, DEFAULT_FRAME_RATE	# Frame delay
	syscall
	
	j update_player_state		# I put these jumps here for visual purpose because they wont actually return, each update function will call upon the next one in this order once they finish
	j update_enemy_state
	j update_bullet_state
	j update_collisions
    
    	j game_loop       		# Loops forever untill loss or win
    	
keypress_happened:
	lw $t2, 4($t9) 			# Assumes $t9 is set to 0xfff0000 from before 
	beq $t2, 0x61, move_left 	# ASCII code of 'a' is 0x61, move left if pressed
	beq $t2, 0x64, move_right 	# ASCII code of 'd' is 0x64, move right if pressed
	beq $t2, 0x77, jump		# ASCII code of 'w' is 0x77, jump up if pressed
	beq $t2, 0x71, quit		# ASCII code of 'q' is 0x71, quit the game if pressed
	beq $t2, 0x72, reset		# ASCII code of 'r' is 0x72, reset the game if pressed
	
	j update_player_state
	
#### Enemies ####
update_enemy_state:
	jal draw_shooter1 		# Bottom riight enemy	
	jal draw_shooter2		# Top right enemy
	
	jal move_roller			# Cyan ball moving left and right
	jal move_drone			# Dark blue drone moving accross the ceiling
	
	j update_bullet_state
	
	
move_roller:
    	lw   $t1, rollerFrameCount  	# Load frame count since it was moving too fast without it
    	addi $t1, $t1, 1                # Increment the frame counter
    	sw   $t1, rollerFrameCount  	
    	bne  $t1, 2, roller_end 	# If counter is not 2 then we skip this frame otherwise we can reset it and continue

    	sw   $zero, rollerFrameCount  	# Reset counter to 0
    	
    	lw $t0, rollerDirection 	# Check direction to move in
    	beqz $t0, roller_right
    	bnez $t0, roller_left
    	
	roller_left:
		jal erase_roller      	
    		lw $t7, rollerLocation
    		addi $t7, $t7, -4     	# Move left by 1 pixel
    		sw $t7, rollerLocation
    		jal draw_roller
    		
    		lw $t7, rollerCount
    		addi $t7, $t7, 1     	# Incerement roller count
    		sw $t7, rollerCount
    		
		bne $t7, 14, roller_end	# If we have not done 14 moves then we can end
		
    		sw $zero, rollerCount
    		sw $zero, rollerDirection # Change roller direction to 0 for right since it did 14 moves
    		
	roller_right:
		jal erase_roller      	
    		lw $t7, rollerLocation
    		addi $t7, $t7, 4     	# Move right by 1 pixel
    		sw $t7, rollerLocation
    		jal draw_roller
    		
    		lw $t7, rollerCount
    		addi $t7, $t7, 1     	# Incerement roller count
    		sw $t7, rollerCount
    		
		bne $t7, 14, roller_end
		
    		sw $zero, rollerCount
    		
    		addi $t0, $t0, 1
    		sw $t0, rollerDirection # Change roller direction to 1 for left since it did 14 moves
    		
	roller_end:
		j move_drone
		
		
move_drone:
    	lw   $t1, droneFrameCount  	# Load frame count since it was moving too fast without it
    	addi $t1, $t1, 1                # Increment the frame counter
    	sw   $t1, droneFrameCount  	
    	bne  $t1, 2, drone_end 		# If counter is not 2 then we skip this frame otherwise we can reset it and continue

    	sw   $zero, droneFrameCount  	# Reset counter to 0
    	
    	lw $t0, droneDirection 		# Check direction to move in
    	beqz $t0, drone_right
    	bnez $t0, drone_left
    	
	drone_left:
		jal erase_drone      	
    		lw $t7, droneLocation
    		addi $t7, $t7, -4     	# Move left by 1 pixel
    		sw $t7, droneLocation
    		jal draw_drone		
    		
    		lw $t7,droneCount
    		addi $t7, $t7, 1     	# Incerement drone count
    		sw $t7, droneCount
    		
		bne $t7, 25, drone_end	# If we have not done 14 moves then we can end
		
    		sw $zero, droneCount
    		sw $zero, droneDirection # Change drone direction to 0 for right since it did 25 moves
    		
	drone_right:
		jal erase_drone      	
    		lw $t7, droneLocation
    		addi $t7, $t7, 4     	# Move right by 1 pixel
    		sw $t7, droneLocation
    		jal draw_drone
    		
    		lw $t7, droneCount
    		addi $t7, $t7, 1     	# Incerement drone count
    		sw $t7, droneCount
    		
		bne $t7, 25, drone_end
		
    		sw $zero, droneCount
    		
    		addi $t0, $t0, 1
    		sw $t0, droneDirection # Change drone direction to 1 for left since it did 25 moves
    		
	drone_end:
		j update_bullet_state


update_bullet_state:
	j bullet_left
	j update_collisions


draw_bullet1:
    lw   $t0, locbullet1  		# Bullet location
    lw   $t1, bulletColour              # Bullet colour
    sw   $t1, 0($t0)                    # Draw left pixel
    addi $t0, $t0, 4                    
    sw   $t1, 0($t0)                    # Draw right pixel
    
    jr   $ra
   
   
erase_bullet1:
    lw $s0, locbullet1   		# Bullet location
    li $t1, BASE_ADDRESS           	
    la $t2, level                       
    sub $t3, $s0, $t1 			# Curent bullet location - BASE_ADDRESS to find how much they differ by
    add $t2, $t2, $t3			# Add this difference to the address of the array index for the level
	
    lw $t4, 0($t2)                      # Background colour at bullet left pixel
    sw $t4, 0($s0) 			# Store the pixel to display
    
    
    addi $s0, $s0, 4  			# Position of right pixel on display
    addi $t2, $t2, 4                    
    lw $t4, 0($t2)			# Background colour at bullet right pixel
    sw $t4, 0($s0)			# Store the next pixel to the right to the display
   
    jr $ra


draw_bullet2:
    lw   $t0, locbullet2  		# Bullet location
    lw   $t1, bulletColour              # Bullet colour
    sw   $t1, 0($t0)                    # Draw left pixel
    addi $t0, $t0, 4                    
    sw   $t1, 0($t0)                    # Draw right pixel
    
    jr   $ra
   
   
erase_bullet2:
    lw $s0, locbullet2   		# Bullet location
    li $t1, BASE_ADDRESS           	
    la $t2, level                       
    sub $t3, $s0, $t1 			# Curent bullet location - BASE_ADDRESS to find how much they differ by
    add $t2, $t2, $t3			# Add this difference to the address of the array index for the level
	
    lw $t4, 0($t2)                      # Background colour at bullet left pixel
    sw $t4, 0($s0) 			# Store the pixel to display
    
    
    addi $s0, $s0, 4  			# Position of right pixel on display
    addi $t2, $t2, 4                    
    lw $t4, 0($t2)			# Background colour at bullet right pixel
    sw $t4, 0($s0)			# Store the next pixel to the right to the display
   
    jr $ra
    
    
bullet_left:
	jal erase_bullet1       	
	jal bullet_collision1		# Checks for collision before incrementing
    	lw   $t1, locbullet1   		
    	addi $t1, $t1, -4               # Move left by 1 pixel
    	sw   $t1, locbullet1   		
    	jal draw_bullet1
    	
    	jal erase_bullet2       	
	jal bullet_collision2		# Checks for collision before incrementing
    	lw   $t1, locbullet2   		
    	addi $t1, $t1, -4               # Move left by 1 pixel 
    	sw   $t1, locbullet2   		
    	jal draw_bullet2
    	
    	j update_collisions
    

bullet_collision1:
	lw $t0, locbullet1 		# Bullet location
	li $s0, BASE_ADDRESS
	la $t1, level
	
	lw $t4, platformColour
	
	addi $t0, $t0, -4		# Location we are checking
	sub $t2, $t0, $s0 		# Curent location we are checking - BASE_ADDRESS to find how much they differ by
	add $t1, $t1, $t2		# Add this difference to the address of the array index for the level
	
	lw $t3, 0($t1) 			# Load the background pixel
	beq $t3, $t4, reset_bullet1	# If the background colour at this position equals the platform colour then there is a collision
	
	jr $ra
	
	reset_bullet1:
		lw $t5, locoriginalBullet1
		sw $t5, locbullet1     # Bullet location changes to its starting position
		
		jr $ra
		
		
bullet_collision2:
	lw $t0, locbullet2 		# Bullet location
	li $s0, BASE_ADDRESS
	la $t1, level
	
	lw $t4, platformColour
	
	addi $t0, $t0, -4		# Location we are checking
	sub $t2, $t0, $s0 		# Curent location we are checking - BASE_ADDRESS to find how much they differ by
	add $t1, $t1, $t2		# Add this difference to the address of the array index for the level
	
	lw $t3, 0($t1) 			# Load the background pixel
	beq $t3, $t4, reset_bullet2 	# If the background colour at this position equals the platform colour then there is a collision
	
	jr $ra
	reset_bullet2:
		lw $t5, locoriginalBullet2
		sw $t5, locbullet2     # Bullet location changes to its starting position
		
		jr $ra
	
#### Movement up/down/left/right ####
move_left:
    	jal check_collision_left 	# Check if its safe to move right
    	lw $t0, collision
    	bnez $t0, abort_move
    	
    	jal erase_player      		# Erase current sprite by re-drawing the level background
    	lw $t7, curPlayerLocation
    	addi $t7, $t7, -4     		# Move left by 1 pixel (4 bytes)
    	sw $t7, curPlayerLocation
    	jal draw_player       		# Draw sprite in the new location
    	
    	jal check_collision_left	# Check collision again to see if the character can move one more pixel
    	lw $t0, collision
    	bnez $t0, abort_move
    	
    	jal erase_player      		# Erase current sprite by re-drawing the level background
    	lw $t7, curPlayerLocation
    	addi $t7, $t7, -4     		# Move left by 1 pixel (4 bytes)
    	sw $t7, curPlayerLocation
    	jal draw_player			# Draw sprite in the new location
    	
    	j update_player_state
    	
    	
move_right:
    	jal check_collision_right	# Check if its safe to move right
    	lw $t0, collision
    	bnez $t0, abort_move
    
    	jal erase_player		# Erase current sprite by re-drawing the level background
    	lw $t7, curPlayerLocation
    	addi $t7, $t7, 4      		# Move right by 1 pixel (4 bytes)
    	sw $t7, curPlayerLocation
    	jal draw_player			# Draw sprite in the new location
    	
    	jal check_collision_right	# Check collision again to see if the character can move one more pixel
    	lw $t0, collision
    	bnez $t0, abort_move
    	
    	jal erase_player		# Erase current sprite by re-drawing the level background
    	lw $t7, curPlayerLocation
    	addi $t7, $t7, 4      		# Move right by 1 pixel (4 bytes)
    	sw $t7, curPlayerLocation
    	jal draw_player			# Draw sprite in the new location
    	
    	j update_player_state
    	
    	
jump:
	lw   $t0, jumpCount       	# Load jumpCount
   	bge  $t0, 2, abort_move 	# If jumpCount >=2 then no more jumps are left
   	
   	lw $t1, playerState		
   	beq $t1, 2, air_jump		# If the playerState is falling then we can jump in air
   	
   	beqz  $t0, jump_from_ground  	# If jumpCount is 0, this is the ground jump, if else its a double jump
   	
   	jal check_collision_above 	# Check to see if character is touching the roof before trying to jump
    	lw $t0, collision        
    	bnez  $t0, abort_move
    	
    	la $t0, playerState		# Update the player state to jumping
	li $t1, 1
	sw $t1, 0($t0)
    	
    	la   $t0, jumpFrames		# Reset the amount of frames the jump lasts
    	li   $t1, 0
    	sw   $t1, 0($t0)
    	
    	j    double_jump

	
jump_from_ground:
	jal check_collision_below 	# Check to see if charachter is touching the ground before trying to jump
    	lw $t0, collision        
    	beqz  $t0, abort_move
    	
    	jal check_collision_above 	# Check to see if character is touching the roof before trying to jump
    	lw $t0, collision        
    	bnez  $t0, abort_move
    	
    	la $t0, playerState		# Update the player state to jumping
	li $t1, 1
	sw $t1, 0($t0)
	
	la $t0, jumpFrames		# Reset the jump frames of the character
    	li $t1, 0
	sw $t1, 0($t0)
	
	double_jump:
		la $t0, playerState	# Update the player state to jumping
		li $t1, 1
		sw $t1, 0($t0)
	
		la   $t0, jumpCount	# Add one to the jump count
    		lw   $t1, 0($t0)
    		addi $t1, $t1, 1
    		sw   $t1, 0($t0)
    		
    		j update_player_state
    		
    	air_jump:
    		la   $t0, jumpFrames	# Reset the jump frames of the character
    		li   $t1, 0
    		sw   $t1, 0($t0)
    	
    		la $t0, playerState	# Update the player state to jumping
		li $t1, 1
		sw $t1, 0($t0)
	
		la   $t0, jumpCount 	# Set the jump count to 2 since we dont want to jump twice if  I started falling off a platform
    		lw   $t1, 0($t0)
    		addi $t1, $t1, 2
    		sw   $t1, 0($t0)
    		
    		j update_player_state
	
		
jumping_state:
	jal check_collision_above 	# Check to see if charachter is touching the ground before trying to jump
    	lw $t0, collision        
    	bnez  $t0, change_fall_state
	
	lw $t1, jumpFrames
	bleu $t1, 7, jumping		# Move up 7 pixels maximum for a jump
	beq $t1, 14, change_fall_state	# Dont change state untill another 7 frames so the character floats at the peak of jump for a bit
	
	la $t0, jumpFrames		# Update the jump frames of the character
    	lw $t1, jumpFrames
    	addi $t1, $t1, 1		# Increment jump frames
	sw $t1, 0($t0)
	
	j update_enemy_state


jumping:
	jal erase_player      		# Erase current sprite by re-drawing the level background
    	lw $t7, curPlayerLocation
    	addi $t7, $t7, -OFFSET     	# Move up by one pixel as a jump
    	sw $t7, curPlayerLocation
    	jal draw_player                 # Draw sprite in the new location
    	
    	la $t0, jumpFrames		# Update the jump frames of the character
    	lw $t1, jumpFrames
    	addi $t1, $t1, 1         	# Increment jump frames
	sw $t1, 0($t0)
    	
    	j update_enemy_state


update_player_state:
	lw $t0, playerState

	beq $t0, 1, jumping_state 	# Check if in jumpstate
	beq $t0, 2, falling_state 	# Check if in fallstate
	
	jal check_collision_below	# Check if character is on a platform
	lw $t1, collision
	bnez $t1, update_enemy_state 		# Character is standing
	
	j change_fall_state		# If the character is not on a platform then change to falling state
	
	
change_fall_state:
		la $t0, playerState	# Update the player state to falling
		li $t1, 2
		sw $t1, 0($t0)
		
		j update_enemy_state
		
		
change_stand_state:
	la $t0, playerState		# Update the player state to standing
	li $t1, 0
	sw $t1, 0($t0)
	
	la $t0, jumpFrames		# Update the jump frames of the character
    	li $t1, 0
	sw $t1, 0($t0)
	
    	la   $t0, jumpCount 		# Reset Jump count
    	li   $t1, 0
    	sw   $t1, 0($t0)
    	
	j update_enemy_state
	
	
falling_state:
	jal check_collision_below 	# Check if player is standing on a platform
	lw $t0, collision
    	bnez $t0, change_stand_state
    	
    	j fall				# If they are not on a platform then fall
    	
    	
fall:
	jal erase_player      		# Erase current sprite by re-drawing the level background
    	lw $t7, curPlayerLocation
    	addi $t7, $t7, OFFSET     	# Move down by one pixel
    	sw $t7, curPlayerLocation
    	jal draw_player
    	
    	j update_enemy_state
    
    
abort_move:
    j update_player_state
	
#### Drawing ####
draw_shooter1:
	lw $s6, shooterLocation1
	la $s7, shooter_sprite
	
	j draw_entity
	
	
draw_shooter2:
	lw $s6, shooterLocation2
	la $s7, shooter_sprite
	
	j draw_entity
	
	
draw_roller:
	lw $s6, rollerLocation
	la $s7, roller_sprite
	
	j draw_entity
	
	
draw_drone:
	lw $s6, droneLocation
	la $s7, drone_sprite
	
	j draw_entity
	
	
draw_player:
	lw $s6, curPlayerLocation
	la $s7, player_sprite
	
	j draw_entity
	
	
draw_entity: # Note: I realized I could alter this so that if all my sprites are 8x8 I can draw any of them, so it takes in the parameters in $s6, $s7 which is location and sprite respectively
	move $s0, $s6
	move $s1, $s7
	li $s4, 0x000000 		# BLACK since my sprites have black extra pixels
	
	li $s2, 8 			# Rows
	row_loop:
		beqz $s2, exit_draw_entity
		
		li $s3, 8 		# Columns
	col_loop:
		beqz $s3, finish_row 	# Move to the next row once this row is finished
		
		lw $t2, 0($s1) 		# Load sprite pixel
		beq $t2, $s4, skip_pixel # If pixel is black in the sprite then skip overwriting it
		sw $t2, 0($s0) 		# Store the pixel to display
	skip_pixel:
		addi $s1, $s1, 4 	# Next sprite pixel
		addi $s0, $s0, 4 	# Next display pixel
		subi $s3, $s3, 1 	# Decrement Col counter
		j col_loop
	finish_row:
		li $t3, 64 		# Number of pixel units in a row
		sub $t3, $t3, 8 	# Subtract the amount of pixels/ columns we wrote to
		sll $t3, $t3, 2 	# Shift twice to multiply by 4 bytes per pixel
		
		add $s0, $s0, $t3 	# Next Rows first display pixel
		
		subi $s2, $s2, 1 	# Decrement Row counter
		j row_loop
		
	exit_draw_entity:
		jr $ra
		
draw_hearts:
	lw $t0, heartStart 		# Location of the first heart
	lw $t1, lives			# Lives left
	
	draw_heart:
		beqz $t1, end_hearts	# Done drawing hearts
		move $s6, $t0
		la $s7, heart_sprite
		jal draw_entity
		
		addi $t1, $t1 -1
		addi $t0, $t0, 36 # Increment the space between each heart starting location by 9
		
		j draw_heart
		
	end_hearts:
		j game_loop
		
#### Erasing ####
erase_shooter1:
	lw $s6, shooterLocation1
	j erase_entity
	
	
erase_shooter2:
	lw $s6, shooterLocation2
	j erase_entity
	
	
erase_roller:
	lw $s6, rollerLocation
	j erase_entity
	
	
erase_drone:
	lw $s6, droneLocation
	j erase_entity
	
	
erase_player:
	lw $s6, curPlayerLocation
	j erase_entity
	
		
erase_entity: # Note: I realized I could alter this so that if all my sprites are 8x8 I can erase any of them, so it takes in the parameters in $s6 which is the location to erase
	move $s0, $s6
	li $t1, BASE_ADDRESS
	la $t2, level
	sub $t3, $s0, $t1 		# Curent player location - BASE_ADDRESS to find how much they differ by
	add $t2, $t2, $t3		# Add this difference to the address of the array index for the level
	
	li $s1, 8 			# Rows
	erase_row:
		beqz $s1, exit_erase_entity
		
		li $s2, 8 		# Columns
	erase_col:
		beqz $s2, row_erased
		lw $t4, 0($t2) 		# Load background pixel
		sw $t4, 0($s0) 		# Store the pixel to display
		addi $s0, $s0, 4 	# Increment the display pixel
		addi $t2, $t2, 4 	# Increment the background pixel
		
		subi $s2, $s2, 1 	# Decrement Column counter
		j erase_col
		
	row_erased:
		li $t5, 64 		# Number of pixel units in a row
		subi $t5, $t5, 8 	# Subtract the amount of pixels/ columns we wrote to
		sll $t5, $t5, 2 	# Shift twice to multiply by 4 bytes per pixel

		add $s0, $s0, $t5 	# Next Rows first display pixel
		add $t2, $t2, $t5 	# Next Rows matching background pixel
		
		subi $s1, $s1, 1 	# Decrement Row counter
		j erase_row
		
	exit_erase_entity:
		jr $ra
	
	
#### Collision Detection for Player ####
check_collision_left:
	lw $t0, curPlayerLocation
	li $s0, BASE_ADDRESS
	la $t1, level
	
	lw $t4, platformColour
	
	addi $t0, $t0, 8		# Original sprite is off by 2 pixels
	
	addi $t0, $t0, -4		# Location we are checking
	sub $t2, $t0, $s0 		# Curent player location - BASE_ADDRESS to find how much they differ by
	add $t1, $t1, $t2		# Add this difference to the address of the array index for the level
	
	li $t8, 8 			# Row counter
	collision_left_loop:
		beqz $t8, no_collision_left
		
		lw $t3, 0($t1) 		# Load the background pixel
		beq $t3, $t4, found_collision_left # If the background colour at this position equals the platform colour then there is a collision
		
		li $t5, OFFSET 		# Offset for my pixels
		
		add $t1, $t1, $t5 	# Find the next pixel to check by adding offset
		
		subi $t8, $t8, 1 	# Decrement Row counter
		
		j collision_left_loop
		
	no_collision_left:
		la $s1, collision 	# Update the collision variable
		li $s2, 0
		sw $s2, 0($s1)
		jr $ra
	
	found_collision_left:
		la $s1, collision 	# Update the collision variable
		li $s2, 1
		sw $s2, 0($s1)
		jr $ra 
		 
		 
check_collision_right:
	lw $t0, curPlayerLocation
	li $s0, BASE_ADDRESS
	la $t1, level
	
	lw $t4, platformColour
	
	addi $t0, $t0, 24		# The right side of my sprite
	
	addi $t0, $t0, 4		# Location we are checking
	sub $t2, $t0, $s0 		# Curent player location - BASE_ADDRESS to find how much they differ by
	add $t1, $t1, $t2		# Add this difference to the address of the array index for the level
	
	li $t8, 8 			# Row counter
	collision_right_loop:
		beqz $t8, no_collision_right
		
		lw $t3, 0($t1) 		# Load the background pixel
		beq $t3, $t4, found_collision_right # If the background colour at this position equals the platform colour then there is a collision
		
		li $t5, OFFSET 		# Offset for my pixels
	
		add $t1, $t1, $t5	# Find the next pixel to check by adding offset
		
		subi $t8, $t8, 1 	# Decrement Row counter
		
		j collision_right_loop
		
	no_collision_right: 
		la $s1, collision 	# Update the collision variable
		li $s2, 0
		sw $s2, 0($s1)
		jr $ra
	
	found_collision_right:
		la $s1, collision 	# Update the collision variable
		li $s2, 1
		sw $s2, 0($s1)
		jr $ra 


check_collision_below:
	lw $t0, curPlayerLocation
	li $s0, BASE_ADDRESS
	la $t1, level
	
	lw $t4, platformColour
	
	addi $t0, $t0, 8		# The left side of my sprite
	
	li $t5, OFFSET 			# Offset for my pixels
	
	mul $t5, $t5, 8			# We need to move down by 8 pixels to reach the bottom of the sprite
	
	add $t0, $t0, $t5		# Adding this offset
	
	sub $t2, $t0, $s0 		# Curent player location - BASE_ADDRESS to find how much they differ by
	add $t1, $t1, $t2		# Add this difference to the address of the array index for the level
	
	li $t8, 5
	collision_below_loop:
	
		beqz $t8, no_collision_below
		
		lw $t3, 0($t1) 		# Load the background pixel
		beq $t3, $t4, found_collision_below # If the background colour at this position equals the platform colour then there is a collision
		
		addi $t1, $t1, 4 	# Move one pixel to the right
		
		subi $t8, $t8, 1 	# Decrement Row counter
		
		j collision_below_loop
	
	no_collision_below:
		la $s1, collision 	# Update the collision variable
		li $s2, 0
		sw $s2, 0($s1)
		jr $ra
		
	found_collision_below:
		la $s1, collision 	# Update the collision variable
		li $s2, 1
		sw $s2, 0($s1)
		jr $ra 
	
	
check_collision_above:
	lw $t0, curPlayerLocation
	li $s0, BASE_ADDRESS
	la $t1, level
	
	lw $t4, platformColour
	
	addi $t0, $t0, 8		# The left side of my sprite
	
	li $t5, -OFFSET 		# Offset for my pixels
	
	add $t0, $t0, $t5		# Adding this offset
	
	sub $t2, $t0, $s0 		# Curent player location - BASE_ADDRESS to find how much they differ by
	add $t1, $t1, $t2		# Add this difference to the address of the array index for the level
	
	li $t8, 5
	collision_above_loop:
	
		beqz $t8, no_collision_above
		
		lw $t3, 0($t1) 		# Load the background pixel
		beq $t3, $t4, found_collision_above # If the background colour at this position equals the platform colour then there is a collision
		
		addi $t1, $t1, 4 	# Move one pixel to the right
		
		subi $t8, $t8, 1 	# Decrement Row counter
		
		j collision_above_loop
	
	no_collision_above:
		la $s1, collision 	# Update the collision variable
		li $s2, 0
		sw $s2, 0($s1)
		jr $ra
		
	found_collision_above:
		la $s1, collision 	# Update the collision variable
		li $s2, 1
		sw $s2, 0($s1)
		jr $ra 


update_collisions:
	lw $t0, curPlayerLocation
	addi $t0, $t0, 8		# Original sprite is off by 2 pixels
	
	lw $t4, bulletColour
	lw $t6, shooterColour
	lw $t7, rollerColour
	lw $t8, droneColour
	lw $s5, wrenchColour
	
	
	li $s1, 8 			# Rows
	update_row:
		beqz $s1, exit_update_collisions
		
		li $s2, 5 		# Columns
	update_col:
		beqz $s2, row_updated
		lw $t9, 0($t0)
					# Comparisons
		beq $t9, $t4, respawn	# Hit by bullet or falls in lava
		beq $t9, $t6, respawn	# Touches the shooting enemy
		beq $t9, $t7, respawn	# Touches the rolling enemy
		beq $t9, $t8, respawn   # Touches the drone enemy
		beq $t9, $s5, win_screen   # Touches the drone enemy
		
		addi $t0, $t0, 4 	# Increment the location pixel
		
		subi $s2, $s2, 1 	# Decrement Column counter
		
		j update_col
		
	row_updated:
		li $t5, 64 		# Number of pixel units in a row
		subi $t5, $t5, 5 	# Subtract the amount of pixels/ columns we checked
		sll $t5, $t5, 2 	# Shift twice to multiply by 4 bytes per pixel

		add $t0, $t0, $t5 	# Next Rows first pixel to check
		
		subi $s1, $s1, 1 	# Decrement Row counter
		
		j update_row
		
	exit_update_collisions:
		j game_loop
		
#### End the program ####
quit:
	li $v0, 10
	syscall

